import React, { useState } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Login from "./components/Login"; // Corrected case
import Signup from "./components/Signup"; // Corrected case
import News from "./components/News"; // Corrected case
import Navbar from "./components/Navbar"; // Corrected case
import "./App.css";

const App = () => {
  const [preferences, setPreferences] = useState("");

  return (
    <Router>
      <div className="app">
        <Navbar setPreferences={setPreferences} />
        <Switch>
          <Route path="/login" component={Login} />
          <Route path="/signup" component={Signup} />
          <Route path="/" exact>
            <News preferences={preferences} />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;
